// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Tickbit is Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _eventsIds;

    mapping(uint256 => EventItem) private idToEvent;

    struct EventItem {
        address _owner;
        uint _id;
        string title;
        string city;
        string description;
        string artist;
        string coverImageUrl;
        uint category;
    }

    event EventItemCreated (
        address indexed _owner,
        uint indexed _id,
        string title,
        string city,
        string description,
        string artist,
        string coverImageUrl,
        uint category
    );

    constructor() {
        createEvent(
            0xE52d770EFD323897E4F86deCD87F78437c20Df89,
            "El Nano Tour",
            "Barcelona",
            "Ramon Melendi Espina, conocido artisticamente como Melendi, es un cantautor y compositor espanol de musica pop y rumba. De joven sentia atraccion por el futbol, deporte que lo condujo por una corta carrera de futbolista, debutando en varias categorias inferiores en el equipo de su ciudad, el Real Oviedo.",
            "Melendi",
            "https://www.lavanguardia.com/files/image_948_465/uploads/2015/12/13/5fa30833aa1e4.jpeg",
            1
        );
        createEvent(
            0xE52d770EFD323897E4F86deCD87F78437c20Df89,
            "11 razones tour", 
            "Madrid", 
            "Aitana se ha convertido en un fenomeno musical y social tras su paso por Operacion Triunfo en esta primera edicion de la nueva etapa del programa.", 
            "Aitana", 
            "https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/aitana-11-razones-tour-fechas-ciudades-1618312520.jpg?crop=1.00xw:0.402xh;0,0.0448xh&resize=1200:*", 
            1
        );
    }

    /**
     * @dev Creates and registers a new event
     * @param _owner The contract address that is creating this event
     * @param title Title of the event
     * @param city City of the event
     * @param description Description of the event
     * @param artist Name of the artist of the event
     * @param coverImageUrl Url of the cover image of the event
     * @param category Category id of the event
     */
    function createEvent(address _owner, string memory title, string memory city, string memory description, string memory artist, string memory coverImageUrl, uint category) public {        
        //require(msg.sender == _owner, 'Invalid owner');

        _eventsIds.increment();
        uint256 eventId = _eventsIds.current();

        idToEvent[eventId] = EventItem(
            _owner,
            eventId,
            title,
            city,
            description,
            artist,
            coverImageUrl,
            category
        );

        emit EventItemCreated(
            _owner,
            eventId,
            title,
            city,
            description,
            artist,
            coverImageUrl,
            category
        );
    }

    /**
     * @dev Reads the event with the id specified if exists
     * @param id Id of the event to read
     * @return idToEvent[id] EventItem struct with the specified id
     */
    function readEvent(uint256 id) public view returns(EventItem memory) {
        require(idToEvent[id]._id != 0, "This contract does not exist");

        return idToEvent[id];
    }

    /**
     * @dev Reads all events
     * @return EventItem[] EventItem structs array with all the events
     */
    function readAllEvents() public view onlyOwner returns(EventItem[] memory){
        uint eventCount = _eventsIds.current();
        uint currentIndex = 0;

        EventItem[] memory events = new EventItem[](eventCount);

        for (uint i = 0; i < eventCount; i++) {
            uint currentId = i + 1;
            EventItem storage currentEvent = idToEvent[currentId];
            events[currentIndex] = currentEvent;
            currentIndex += 1;
        }

        return events;
    }



    /**
     * @dev Reads all events from sender address
     * @return EventItem[] EventItem structs array with the events of the sender address
     */
    function readMyEvents() public view returns(EventItem[] memory) {
        uint eventCount = _eventsIds.current();
        uint currentIndex = 0;

        EventItem[] memory events = new EventItem[](eventCount);

        for (uint i = 0; i < eventCount; i++) {
            if (idToEvent[i + 1]._owner == msg.sender) {
                uint currentId = i + 1;
                EventItem storage currentEvent = idToEvent[currentId];
                events[currentIndex] = currentEvent;
                currentIndex += 1;
            }
        }

        return events;
    }
}

